import React from 'react';
import { motion } from 'framer-motion';
import { 
  MapPinIcon,
  PhoneIcon,
  EnvelopeIcon,
  ClockIcon
} from '@heroicons/react/24/outline';

const ContactInfoSection = () => {
  const contactInfo = [
    {
      icon: MapPinIcon,
      label: 'Adresă',
      value: 'Strada Furnica nr. 52, Sinaia, România'
    },
    {
      icon: PhoneIcon,
      label: 'Telefon',
      value: '+40 244 315 000'
    },
    {
      icon: EnvelopeIcon,
      label: 'Email',
      value: 'contact@hotelmarami.ro / rezervari@hotelmarami.ro'
    },
    {
      icon: ClockIcon,
      label: 'Program Recepție',
      value: 'Luni–Duminică: 08:00 – 22:00'
    }
  ];

  const quickActions = [
    {
      icon: PhoneIcon,
      label: 'Sună acum',
      href: 'tel:+40244315000',
      color: 'bg-green-500 hover:bg-green-600'
    },
    {
      icon: EnvelopeIcon,
      label: 'Trimite email',
      href: 'mailto:contact@hotelmarami.ro',
      color: 'bg-blue-500 hover:bg-blue-600'
    },
    {
      icon: MapPinIcon,
      label: 'Deschide în Google Maps',
      href: 'https://maps.google.com/?q=Strada+Furnica+52+Sinaia+Romania',
      color: 'bg-red-500 hover:bg-red-600'
    }
  ];

  return (
    <section className="section-padding bg-background-secondary">
      <div className="container-custom">
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.8 }}
          className="text-center mb-16"
        >
          <h2 className="text-3xl md:text-4xl font-display font-bold text-text-primary mb-4">
            Date de Contact Principale
          </h2>
          <p className="text-lg text-text-light max-w-2xl mx-auto">
            Găsește-ne ușor și contactează-ne pentru orice întrebare sau rezervare.
          </p>
        </motion.div>

        {/* Contact Info Table */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.8, delay: 0.2 }}
          className="bg-white rounded-2xl shadow-lg overflow-hidden mb-12"
        >
          <div className="overflow-x-auto">
            <table className="w-full">
              <tbody className="divide-y divide-gray-100">
                {contactInfo.map((info, index) => {
                  const IconComponent = info.icon;
                  return (
                    <motion.tr
                      key={index}
                      initial={{ opacity: 0, x: -20 }}
                      whileInView={{ opacity: 1, x: 0 }}
                      viewport={{ once: true }}
                      transition={{ duration: 0.5, delay: index * 0.1 }}
                      className="hover:bg-gray-50 transition-colors"
                    >
                      <td className="px-6 py-4">
                        <div className="flex items-center space-x-3">
                          <span className="inline-flex items-center justify-center w-8 h-8 bg-primary-100 rounded-full">
                            <IconComponent className="w-5 h-5 text-primary-500" />
                          </span>
                          <span className="font-medium text-text-primary">{info.label}</span>
                        </div>
                      </td>
                      <td className="px-6 py-4">
                        <span className="text-text-secondary">{info.value}</span>
                      </td>
                    </motion.tr>
                  );
                })}
              </tbody>
            </table>
          </div>
        </motion.div>

        {/* Quick Action Buttons */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.8, delay: 0.4 }}
          className="flex flex-col sm:flex-row gap-4 justify-center"
        >
          {quickActions.map((action, index) => {
            const IconComponent = action.icon;
            return (
              <motion.a
                key={index}
                href={action.href}
                target="_blank"
                rel="noopener noreferrer"
                initial={{ opacity: 0, y: 20 }}
                whileInView={{ opacity: 1, y: 0 }}
                viewport={{ once: true }}
                transition={{ duration: 0.6, delay: index * 0.1 }}
                whileHover={{ scale: 1.05 }}
                whileTap={{ scale: 0.95 }}
                className={`${action.color} text-white px-6 py-3 rounded-xl font-semibold shadow-lg transition-all duration-300 flex items-center justify-center space-x-2`}
              >
                <IconComponent className="w-5 h-5" />
                <span>{action.label}</span>
              </motion.a>
            );
          })}
        </motion.div>
      </div>
    </section>
  );
};

export default ContactInfoSection;
